INSERT INTO `ucp_archive` (`id`, `userid`, `characterid`, `answer_1`, `answer_2`, `answer_3`, `answer_1_id`, `answer_2_id`, `answer_3_id`, `desc`, `date`, `sex`, `skin`, `name`, `origin`, `createddate`) VALUES
(1, 3, 3, 'Я ахуею и буду делать все че захочю', 'Я ахуею', 'Я ахуею', 'Вы являетесь продавцом в магазине оружия, вдруг врываются трое неизвестных грабителей в масках и с оружием, позади вас есть крупный калибр, грабители отвернулись. Ваши действия?', 'Вы стоите лицом к своему дому, к вам сзади подходит человек и приставляет пистолет к вашему затылку, что вы будете делать в данной ситуации?', 'После интимных отношений, ваш партнер признается что болен ВИЧ инфекцией, каковы будут ваши действия, учитывая характер персонажа?', 'веб', '1993-01-01', 1, 162, 'Diman_Igolnikov', 'Russia', '1509392308'),
(2, 2, 2, '123123', '123123', '123123', 'Вы взяли кредит в банке, вы его просрочили и ваш долг выкупили коллекторы, через пару часов вам звонят эти самые коллекторы и угрожают расправой, если не выплатите долг. Ваши действия с учетом характера?', 'Вы узнаете, что ваша жена изменила вам с лучшим другом, ваши действия с учетом характера?', 'Вы стоите лицом к своему дому, к вам сзади подходит человек и приставляет пистолет к вашему затылку, что вы будете делать в данной ситуации?', '123123', '1992-04-24', 1, 101, 'Stephen_Kowalski', '??????, ???????.', '1509449837'),
(3, 0, 0, '', '', '', '', '', '', '', '', 0, 0, '', '', ''),
(4, 7, 7, 'hvatay gun i shotay', 'obdolbay-razdolbay', 'obdolbay-razdolbay', 'Вы являетесь продавцом в магазине оружия, вдруг врываются трое неизвестных грабителей в масках и с оружием, позади вас есть крупный калибр, грабители отвернулись. Ваши действия?', 'Что если ваш персонаж попробывал наркотики в первый раз, как себя будет вести ваш персонаж?', 'Что если ваш персонаж попробывал наркотики в первый раз, как себя будет вести ваш персонаж?', 'hz', '1994-04-25', 1, 7, 'Trevor_Calderon', 'USA, San Andreas, Los Santos.', '1509449959'),
(5, 2, 2, 'ФЫФЫВФЫВ', 'ФЫВФЫВ', 'ФЫВЫ', 'Array', 'Array', 'Array', 'ЫФВФЫВФЫВ', '1994-04-24', 1, 7, 'Trayzee_Brooksdale', 'Los Santos, USA.', '1509451216'),
(6, 8, 8, 'жидков лох', 'объелся блох', 'ещкереереререре кукареку ебана', 'Array', 'Array', 'Array', 'пидорас ваще,опасный блять', '1994-11-24', 1, 126, 'Edward_Lorency', '???-??????', '1509451232'),
(7, 0, 0, '', '', '', '', '', '', '', '', 0, 0, '', '', ''),
(8, 15, 15, '.', '.', '.', 'Вы смотрите в окно, и видите как пару людей угоняют ваш автомобиль, после чего благополучно открывают авто и уезжают. Что будет делать ваш персонаж, и его эмоции, с учетом характера?', 'Вы взяли кредит в банке, вы его просрочили и ваш долг выкупили коллекторы, через пару часов вам звонят эти самые коллекторы и угрожают расправой, если не выплатите долг. Ваши действия с учетом характера?', 'В тёмном переулке на вас нападает крупный мужчина в маске с ножом, а вы идёте со своей девушкой домой, ваши действия?', '.', '1996-11-30', 1, 176, 'Austin King', 'United States of America, Los Angeles', '1509456399'),
(9, 17, 17, 'сломать им лица с вертухи', 'сломать им лица с вертухи', 'сломать им лица с вертухи', 'Вы являетесь продавцом в магазине оружия, вдруг врываются трое неизвестных грабителей в масках и с оружием, позади вас есть крупный калибр, грабители отвернулись. Ваши действия?', 'Вам предложили купить пару грамм марихуанны, вы поспешно соглашаетесь, вам говорят о месте и времени, приехав туда на вас наставляют оружие и забирают ваши деньги, ваши действия?', 'В тёмном переулке на вас нападает крупный мужчина в маске с ножом, а вы идёте со своей девушкой домой, ваши действия?', 'анимешник', '3434-02-22', 1, 2, 'Test_Testovich', '????? ??????', '1509463391'),
(10, 19, 19, '1', '1', '1', 'Вы узнаете, что ваша жена изменила вам с лучшим другом, ваши действия с учетом характера?', 'Вы являетесь продавцом в магазине оружия, вдруг врываются трое неизвестных грабителей в масках и с оружием, позади вас есть крупный калибр, грабители отвернулись. Ваши действия?', 'Вы взяли кредит в банке, вы его просрочили и ваш долг выкупили коллекторы, через пару часов вам звонят эти самые коллекторы и угрожают расправой, если не выплатите долг. Ваши действия с учетом характера?', '1', '1995-08-29', 1, 7, 'Trevor_Calderon', 'USA, San Andreas, Los Santos', '1509467000'),
(11, 0, 0, '', '', '', '', '', '', '', '', 0, 0, '', '', ''),
(12, 19, 19, '1', '1', '1', 'Вы стоите лицом к своему дому, к вам сзади подходит человек и приставляет пистолет к вашему затылку, что вы будете делать в данной ситуации?', 'Вы узнаете, что ваша жена изменила вам с лучшим другом, ваши действия с учетом характера?', 'Вы смотрите в окно, и видите как пару людей угоняют ваш автомобиль, после чего благополучно открывают авто и уезжают. Что будет делать ваш персонаж, и его эмоции, с учетом характера?', '1', '1993-05-29', 1, 101, 'Matthew_Bailey', 'USA, Washington, Seattle.', '1509467153'),
(13, 16, 16, 'Developer', 'Developer', 'Developer', 'После интимных отношений, ваш партнер признается что болен ВИЧ инфекцией, каковы будут ваши действия, учитывая характер персонажа?', 'Вы узнаете, что ваша жена изменила вам с лучшим другом, ваши действия с учетом характера?', 'Вы являетесь продавцом в магазине оружия, вдруг врываются трое неизвестных грабителей в масках и с оружием, позади вас есть крупный калибр, грабители отвернулись. Ваши действия?', 'Developer', '1991-09-10', 1, 101, 'Developer_Numb', 'GetPlayerPos(playerid, X, Y, Z);', '1509469746'),
